description:
Sexology Part 1 (The Depths of Female Pleasure / Sam Larke / JoyBear / 2013) 

Tess, a graduate student working on her PhD in Biology, is writing a paper on how pace, position and stimulation all affect the quality of female sexual pleasure. For this study Tess must do a lot of observational and hands-on research. So, what do women really want?

Chapter One: The Chemical Connection - Kathia Nobili (Anal)
Chapter Two: The Pace Study - Mira Sunset
Chapter Three: The Stimulation Study - Tiffany Doll, Tiffany Naylor (Lesbian)
Chapter Four: The Positional Study - Samantha Bentley
Chapter Five: The Physical Connection - Tiffany Naylor

All Sex, Couples, Feature

